import React from "react";
import axios from 'axios';
import Cookies  from 'universal-cookie';
import "./memberCard.css";
import getData from "./getData"



function memberCard(mn) {
  
   try {
     var data = {};
    getData("DisplayedClubMembers",mn).then(() => {
      //alert("sup"))
      data = JSON.parse(localStorage.getItem("item" +mn));

      return (
        <div className="col-md-4">
          <div className="card">
            <div className = "img-holder">
              <img className="card-img-top" id ='load-img' src = {"data:image/jpeg;base64", data.image}/>
            </div>
            <div className="card-block">
              <h5 className="card-title">
                {data.name}
              </h5>
              <h5 className="card-title">
                {data.position}
              </h5>
              <p className="card-text">
                {data.about}
              </p>
              <p>
                <a className="btn btn-primary" href="#">Contact</a>
              </p>
            </div>
          </div>
        </div>
    );

      localStorage.removeItem("item" +mn);
    });
    
    //alert(dat)
    //const data = {}//JSON.parse(dat);
     
   //const encodedData = data.image;
    
   }
    catch (error) {
      alert(error);
      return <div></div>
   }
   
}
export default memberCard;
